INSERT INTO `t_data_table` (`id`, `company_id`, `name`, `group`, `roles`, `enable_role`, `status`, `is_delete`, `script`, `remark`, `data_table_define`, `create_account_id`, `update_account_id`, `create_time`, `update_time`) VALUES (1, 1, '成员代码提交统计', '默认', '[1,11,18]', 1, 1, 0, 'var dataTable={\n    query:[\n		{name:\"部门名称\",type:\"text\"},\n    ],\n    execute(){\n        var d=new Date();\n        var year=d.getFullYear();\n        var month=d.getMonth()+1;\n        if(month>=10){\n            month=year+\'-\'+month;\n        }else{\n            month=year+\'-0\'+month;\n        }\n        //$.info(month)\n        //\n        var departmentName=$.param(\'部门名称\');\n        var accountList=null\n        if(!departmentName){\n            accountList=this.getAllAccountList();\n        }else{\n            accountList=this.getAccountListByDepartmentName(departmentName);\n        }\n        var inAccountIds=\'\';\n        if(accountList){\n            for (i = 0; i < accountList.size(); i++) {\n                inAccountIds=inAccountIds+accountList[i].id;\n                inAccountIds=inAccountIds+\',\';\n            }\n            inAccountIds=inAccountIds.substring(0,inAccountIds.length-1)\n        }\n        //\n		var sheet=$.createSheet();\n        var maxCol=33;\n		sheet.name=\'成员代码提交记录\'+month\n		for(var i=0;i<maxCol;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=60;\n        sheet.col[1].width=60;\n        for(var i=0;i<31;i++){\n            sheet.col[i+2].width=50;\n        }\n        \n		var header0=$.arrayToRow([\'成员代码提交统计\'+month]);\n		header0.cells[0].colspan=maxCol;\n		header0.cells[0].align=\'center\';\n		header0.cells[0].fsize=20;\n		sheet.header.add(header0);\n        //\n        var header=[\'姓名\',\'汇总\'];\n        for(var i=1;i<=31;i++){\n            header.push(i+\"号\")\n        }\n        //\n        var row=$.arrayToRow(header);\n        for(var i=0;i<maxCol;i++){\n            row.cells[i].bgcolor=\"8EE5EE\"\n        }\n        sheet.body.add(row);\n        //\n        if(accountList&&accountList.size()>0){\n            var logList=this.getScmCommitLogList(inAccountIds,month);\n            var map={};\n            for (i = 0; i < logList.size(); i++) {\n                var log=logList.get(i);\n                var accountId=log[\'account_id\']\n                if(!map[accountId]){\n                    map[accountId]={};\n                } \n                map[accountId][log[\'riqi\']]=log\n            }\n            //\n            for (i = 0; i < accountList.size(); i++) {\n                var account=accountList[i];\n                var accountId=account[\'id\']\n                var accountLogList=map[accountId];\n                if(!accountLogList){\n                    continue;\n                }\n                var cols=[account[\'name\']];\n                var monthTotal=0;\n                var dayDatas=[]\n                for(var d=1;d<=31;d++){\n                    var dayData=\'\'\n                    var day=\'\'\n                    if(d<10){\n                        day=month+\'-0\'+d;\n                    }else{\n                        day=month+\'-\'+d;\n                    }\n                    if(accountLogList&&accountLogList[day]){\n                        var accountLog=accountLogList[day];\n                        var totalNum=accountLog[\'total_num\'];\n                        if(totalNum!=0){\n                            monthTotal=monthTotal+totalNum\n                            dayData=totalNum+\'\'\n                        }\n                    }\n                    dayDatas.push(dayData)\n                }\n                cols.push(monthTotal+\'\')\n                cols=cols.concat(dayDatas)\n                row=$.arrayToRow(cols);\n                sheet.body.add(row);\n            }\n        }\n        //\n        $.table.sheets.add(sheet)\n	},\n     getAllAccountList(){\n        var sql=`\n        select a.id,a.name from t_account a \n        where a.company_id=? and a.status=1 order by a.id asc;\n        `\n        var ArrayList = Java.type(\"java.util.ArrayList\")\n        var values = new ArrayList()\n        values.add($.account.companyId);\n        var accountList=$.queryList(sql,values);\n        return accountList;\n    },\n    getAccountListByDepartmentName(departmentName){\n        var sql=`\n        select i2.id,i2.name from t_department a \ninner join t_department i1 on i1.id=a.parent_id\ninner join t_account i2 on i2.id=a.account_id\nwhere a.type=2 and i1.name=? order by i2.id asc;\n        `\n        var ArrayList = Java.type(\"java.util.ArrayList\")\n        var values = new ArrayList()\n        values.add(departmentName);\n        var accountList=$.queryList(sql,values);\n        //$.info(accountList)\n        return accountList;\n    },\n	getScmCommitLogList(accountList,month){\n		var sql=`select DATE_FORMAT(a.create_time, \'%Y-%m-%d\') as riqi,i1.id as account_id,sum(add_line_num) as add_line_num,sum(decrease_line_num) as decrease_line_num,sum(add_line_num-decrease_line_num) as total_num from t_scm_commit_log a\ninner join t_account i1 on i1.user_name=a.author\nwhere 1=1 and i1.id in(`+accountList+`)\nand DATE_FORMAT(a.create_time, \'%Y-%m\')=? \ngroup by riqi,i1.id\norder by i1.id asc\n        `;\n        var ArrayList = Java.type(\"java.util.ArrayList\")\n        var values = new ArrayList()\n        values.add(month);\n		var list=$.queryList(sql,values)\n        //$.info(list)\n        return list;\n		\n	}\n}\n\n\n', '统计成员本月每天的代码提交行数', '{\"query\":[{\"name\":\"部门名称\",\"type\":\"text\"}]}', 3, 3, '2020-02-25 09:49:17', '2020-04-23 10:45:45');
INSERT INTO `t_data_table` (`id`, `company_id`, `name`, `group`, `roles`, `enable_role`, `status`, `is_delete`, `script`, `remark`, `data_table_define`, `create_account_id`, `update_account_id`, `create_time`, `update_time`) VALUES (2, 1, '成员待办列表', '默认', '[1,10]', 1, 1, 0, 'var dataTable={\n    query:[\n        {name:\"成员姓名\",type:\"text\"}\n    ],\n    execute(){\n		var userName=$.param(\'成员姓名\');\n		if(userName==null||userName==\'\'){\n			$.error(\'请输入成员姓名\');\n			return;\n		}\n		this.queryTaskList(userName);\n		this.queryTaskProjectStat(userName);\n		this.queryTaskStatusStat(userName);\n	},\n	queryTaskList(userName){\n		var sheet=$.createSheet();\n		sheet.name=\'待办列表\'\n		//\n		for(var i=0;i<7;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=150;\n		sheet.col[1].width=80;\n		sheet.col[2].width=250;\n		sheet.col[3].width=80;\n		sheet.col[4].width=80;\n		sheet.col[5].width=120;\n		sheet.col[6].width=120;\n		//\n		var row=$.arrayToRow([\'项目\',\'编号\',\'名称\',\'类型\',\'状态\',\'开始时间\',\'结束时间\'])\n		sheet.header.add(row)\n		var sql=`\n		select i3.name as project_name,a.serial_no,a.name,i4.name as object_type_name,i5.name as status_name,a.start_date,a.end_date from t_task a \ninner join t_task_owner i0 on a.id=i0.task_id\ninner join t_account i1 on i0.account_id=i1.id\ninner join t_project_module i2 on i2.object_type=a.object_type and i2.project_id=a.project_id\ninner join t_project i3 on i3.id=a.project_id\ninner join t_object_type i4 on i4.id=a.object_type\ninner join t_project_status_define i5 on i5.id=a.status\nwhere a.is_delete=false and a.is_finish=false and i2.is_status_based=true and i3.status=1 and i1.name=?\norder by i3.name,i5.name\n		`\n		var tasks=$.queryList(sql,[userName])\n		for (i = 0; i < tasks.size(); i++) { \n			var task=tasks.get(i);\n			var mapKey=[\'project_name\',\n						\'serial_no\',\n						\'name\',\n						\'object_type_name\',\n						\'status_name\',\n						\'start_date\',\n						\'end_date\'];\n			sheet.body.add($.mapToRow(task,\n				mapKey,\n				{	\n					\'start_date\':\'fmtDate\',\n					\'end_date\':\'fmtDate\'\n				})\n			)\n		}\n		//\n		$.table.sheets.add(sheet);\n	},\n	queryTaskProjectStat(userName){\n		var sheet=$.createSheet();\n		sheet.name=\'项目统计\'\n		for(var i=0;i<4;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=200;\n		sheet.col[1].width=100;\n		sheet.col[2].width=100;\n		sheet.col[3].width=400;\n\n		var row=$.arrayToRow([\'项目名称\',\'待办数量\'])\n		sheet.header.add(row)\n		\n\n		var sql=`\n		select i1.id,i3.name as project_name,i1.name as account_name,count(1) as num from t_task a \ninner join t_task_owner i0 on a.id=i0.task_id\ninner join t_account i1 on i0.account_id=i1.id\ninner join t_project_module i2 on i2.object_type=a.object_type and i2.project_id=a.project_id\ninner join t_project i3 on i3.id=a.project_id\nwhere a.is_delete=false and a.is_finish=false and i2.is_status_based=true and i3.status=1 and i1.name=?\ngroup by i1.id,i3.id\norder by num desc;\n		`\n		var stat=$.queryList(sql,[userName])\n		for (i = 0; i < stat.size(); i++) { \n			var item=stat[i];\n			sheet.body.add($.mapToRow(item,[\'project_name\',\'num\'],{}))\n		}\n		//\n		var chart=$.createChart();\n        chart.title=\"项目数量\";\n        chart.height=400;\n        chart.cellRange.x1=0;\n        chart.cellRange.x2=1;\n        chart.cellRange.y1=0;\n        chart.cellRange.y2=stat.size()-1;\n        //\n        chart.xAxis.index=0;\n        chart.xAxis.type=\'category\';\n        //\n        chart.yAxis.type=\'value\';\n        //\n        var series1=$.createSeries();\n        series1.index=1;\n        series1.name=\"数量\";\n        series1.type=\"pie\";\n        chart.series.add(series1);\n        //\n        var row=$.arrayToRow([$.toJson(chart)])\n        row.cells[0].type=\'chart\';\n        row.cells[0].colspan=3;\n        sheet.body.add(row);\n		//\n		//\n		$.table.sheets.add(sheet);\n	},\n	queryTaskStatusStat(userName){\n		var sheet=$.createSheet();\n		sheet.name=\'状态统计\'\n		for(var i=0;i<4;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=200;\n		sheet.col[1].width=100;\n		sheet.col[2].width=100;\n		sheet.col[3].width=400;\n\n		var row=$.arrayToRow([\'状态名\',\'数量\'])\n		sheet.header.add(row)\n		\n\n		var sql=`\n		select i1.id,i5.name as status_name,i1.name as account_name,count(1) as num from t_task a \ninner join t_task_owner i0 on a.id=i0.task_id\ninner join t_account i1 on i0.account_id=i1.id\ninner join t_project_module i2 on i2.object_type=a.object_type and i2.project_id=a.project_id\ninner join t_project i3 on i3.id=a.project_id\ninner join t_project_status_define i5 on i5.id=a.status\nwhere a.is_delete=false and a.is_finish=false and i2.is_status_based=true and i3.status=1 and i1.name=?\ngroup by i1.id,i5.name\norder by num desc;\n		`\n		var stat=$.queryList(sql,[userName])\n		for (i = 0; i < stat.size(); i++) { \n			var item=stat[i];\n			sheet.body.add($.mapToRow(item,[\'status_name\',\'num\'],{}))\n		}\n		//\n		var chart=$.createChart();\n        chart.title=\"状态数量\";\n        chart.height=400;\n        chart.cellRange.x1=0;\n        chart.cellRange.x2=1;\n        chart.cellRange.y1=0;\n        chart.cellRange.y2=stat.size()-1;\n        //\n        chart.xAxis.index=0;\n        chart.xAxis.type=\'category\';\n        //\n        chart.yAxis.type=\'value\';\n        //\n        var series1=$.createSeries();\n        series1.index=1;\n        series1.name=\"数量\";\n        series1.type=\"bar\";\n        chart.series.add(series1);\n        //\n        var row=$.arrayToRow([$.toJson(chart)])\n        row.cells[0].type=\'chart\';\n        row.cells[0].colspan=3;\n        sheet.body.add(row);\n		//\n		//\n		$.table.sheets.add(sheet);\n	}\n}\n', '查看成员未完成的事项', '{\"query\":[{\"name\":\"成员姓名\",\"type\":\"text\"}]}', 2, 3, '2019-05-31 17:19:43', '2019-12-03 10:36:08');
INSERT INTO `t_data_table` (`id`, `company_id`, `name`, `group`, `roles`, `enable_role`, `status`, `is_delete`, `script`, `remark`, `data_table_define`, `create_account_id`, `update_account_id`, `create_time`, `update_time`) VALUES (3, 1, '成员待办数量', '默认', '[1]', 1, 1, 1, 'var dataTable={\n    query:[\n    ],\n    execute(){\n		this.queryTaskStatusStat();\n	},\n	queryTaskStatusStat(){\n		var sheet=$.createSheet();\n		sheet.name=\'待办任务数量\'\n		for(var i=0;i<2;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=300;\n		sheet.col[1].width=300;\n		var row=$.arrayToRow([\'责任人\',\'待办任务数量\'])\n		sheet.header.add(row)\n		var sql=`\n			select i1.id,i1.name as account_name,count(1) as num from t_task a \ninner join t_task_owner i0 on a.id=i0.task_id\ninner join t_account i1 on i0.account_id=i1.id\ninner join t_project_module i2 on i2.object_type=a.object_type and i2.project_id=a.project_id\ninner join t_project i3 on i3.id=a.project_id\nwhere a.is_delete=false and a.is_finish=false and i2.is_status_based=true and i3.status=1\ngroup by i1.id\norder by num desc;\n		`\n		var tasks=$.queryList(sql,[])\n		for (i = 0; i < tasks.size(); i++) {\n			var task=tasks.get(i);\n			var mapKey=[\'account_name\',\n						\'num\'];\n			sheet.body.add($.mapToRow(task,mapKey,null))\n		}\n		$.table.sheets.add(sheet);\n	}\n}\n', '待办数量统计', '{\"query\":[]}', 2, 2, '2019-05-31 17:19:43', '2019-06-14 20:42:23');
INSERT INTO `t_data_table` (`id`, `company_id`, `name`, `group`, `roles`, `enable_role`, `status`, `is_delete`, `script`, `remark`, `data_table_define`, `create_account_id`, `update_account_id`, `create_time`, `update_time`) VALUES (4, 1, '需求工时统计', '工时', '[1,10]', 1, 1, 0, ' var dataTable={\n    query:[\n		{name:\"项目\",type:\"project\"}\n    ],\n    execute(){\n		var sheet=$.createSheet();\n		sheet.name=\'工时统计\'\n		for(var i=0;i<9;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=200;\n		sheet.col[1].width=80;\n		sheet.col[2].width=100;\n		sheet.col[3].width=200;\n		sheet.col[4].width=100;\n		sheet.col[5].width=100;\n		sheet.col[6].width=150;\n		sheet.col[7].width=100;\n		sheet.col[8].width=200;\n\n		var header0=$.arrayToRow([this.getProjectName()+\'-工时统计表\']);\n		header0.cells[0].colspan=9;\n		header0.cells[0].align=\'center\';\n		header0.cells[0].fsize=20;\n		\n		this.setupHeaderRow(header0);\n		sheet.header.add(header0)\n		//\n		var header1=$.arrayToRow([\'需求名称\',\'需求状态\',\'工时合计\',\'任务/缺陷/测试计划明细\']);\n		header1.cells[0].rowspan=2;\n		header1.cells[1].rowspan=2;\n		header1.cells[2].rowspan=2;\n		header1.cells[3].colspan=6;\n		//\n		header1.cells[3].align=\'center\';\n		\n		this.setupHeaderRow(header1);\n		sheet.header.add(header1)\n		//\n		var header2=$.arrayToRow([\'名称\',\'状态\',\'责任人\',\'工时录入日期\',\'工时\',\'工时详情\']);\n		//\n		this.setupHeaderRow(header2);\n		sheet.header.add(header2)\n		//\n		var storyList=this.executeSQL();\n		\n\n		for(var i=0;i<storyList.length;i++){\n			var story=storyList[i];\n			var row=$.createRow(9);\n			row.cells[0].value=story[\'name\'];\n			row.cells[1].value=story[\'status_name\'];\n			var hours=this.getWorkTimeTotal(story)\n			if(hours==0){\n				continue;\n			}\n			row.cells[2].value=hours+\"小时\";;\n			\n			var rowspan=story.allList.length;;\n			if(story.allList.length>0){\n				row.cells[0].rowspan=rowspan;\n				row.cells[1].rowspan=rowspan;\n				row.cells[2].rowspan=rowspan;\n			}\n			if(rowspan>=1){\n				var first=story.allList[0];\n				row.cells[3].value=first[\'task_name\'];\n				row.cells[4].value=first[\'task_status_name\'];\n				row.cells[5].value=first[\'owner_name\'];\n				row.cells[6].value=$.fmtDate(first[\'create_time\']);\n				row.cells[7].value=first[\'hour\']+\"小时\";\n				row.cells[8].value=first[\'content\'];\n			}\n			sheet.body.add(row);\n			for(var k=1;k<story.allList.length;k++){\n				var row2=$.createRow(6);\n				var wt=story.allList[k];\n				row2.cells[0].value=wt[\'task_name\'];\n				row2.cells[1].value=wt[\'task_status_name\'];\n				row2.cells[2].value=wt[\'owner_name\'];\n				row2.cells[3].value=$.fmtDate(wt[\'create_time\']);\n				row2.cells[4].value=wt[\'hour\']+\"小时\";\n				row2.cells[5].value=wt[\'content\'];\n				sheet.body.add(row2);\n			}\n\n			\n		}\n		//\n		$.table.sheets.add(sheet)\n	},\n	getWorkTimeTotal(story){\n		var t=0;\n		for(var i=0;i<story.allList.length;i++){\n			t+=story.allList[i].hour;\n		}\n		return t;\n	},\n	setupHeaderRow(row){\n		for(var i=0;i<row.cells.length;i++){\n			row.cells[i].bgcolor=\"eeeeee\"\n		}\n		\n	},\n	getProjectName(){\n		if($.query.projectId){\n			var sql=\'select name from t_project where id=\'+$.query.projectId;\n			return $.queryForString(sql)\n		}\n		$.error(\'请选择项目\')\n	},\n	executeSQL(){\n		var storySQL=`\n			select a.id,concat(\'#\',a.serial_no,\' \',a.name) as name,a.serial_no,i0.name as status_name from t_task a \n			inner join t_project_status_define i0 on a.status=i0.id\n			where a.object_type=3 and a.is_delete=false\n		`;\n		if($.query.projectId){\n			storySQL=storySQL+\' and a.project_id=\'+$.query.projectId+\' \';\n		}\n		if($.query.iterationId){\n			storySQL=storySQL+\' and a.iteration_id=\'+$.query.iterationId+\' \';\n		}\n		var storyList=$.queryList(storySQL);\n		//\n		var workTimeSQL=`\n			select i6.name as object_type_name,i0.id as task_id,concat(\'#\',i0.serial_no,\' \',i0.name) as task_name,i7.name as task_status_name,i4.name as owner_name,a.create_time,a.hour,a.content from t_task_work_time_log a\ninner join t_task i0 on a.task_id=i0.id\ninner join t_account i4 on a.create_account_id=i4.id\ninner join t_object_type i6 on i0.object_type=i6.id\ninner join t_project_status_define i7 on i0.status=i7.id\nwhere 1=1  and i0.is_delete=false\n		`;\n		if($.query.projectId){\n			workTimeSQL=workTimeSQL+\' and i0.project_id=\'+$.query.projectId+\' \';\n		}\n		if($.query.iterationId){\n			workTimeSQL=workTimeSQL+\' and i0.iteration_id=\'+$.query.iterationId+\' \';\n		}\n		var workTimeList=$.queryList(workTimeSQL);\n		//\n		var workTimeMap={};\n		for(var i=0;i<workTimeList.size();i++){\n			var item=workTimeList.get(i);\n			var taskId=item[\'task_id\'];\n			if(workTimeMap[taskId]==null){\n				workTimeMap[taskId]={\n					taskId:taskId,\n					list:[]\n				}\n			}\n			workTimeMap[taskId].list.push(item);\n		}\n		//\n		var relSQL=`\n			select a.task_id,a.associated_task_id from t_task_associated a\ninner join t_task i0 on a.task_id=i0.id\nwhere i0.object_type=3 \n		`;\n		if($.query.projectId){\n			relSQL=relSQL+\' and i0.project_id=\'+$.query.projectId+\' \';\n		}\n		if($.query.iterationId){\n			relSQL=relSQL+\' and i0.iteration_id=\'+$.query.iterationId+\' \';\n		}\n		var relList=$.queryList(relSQL);\n		//\n		for(var i=0;i<storyList.size();i++){\n			var story=storyList[i];\n			story[\'workTimeList\']=[];\n			for(var k=0;k<relList.length;k++){\n				var rel=relList[k];\n				if(rel[\'task_id\']==story.id){\n					var target=workTimeMap[rel[\'associated_task_id\']];\n					if(target){\n						story[\'workTimeList\'].push(target);\n						delete workTimeMap[rel[\'associated_task_id\']];\n					}\n				}\n			}\n		}\n		//未关联需求的任务\n		var otherStory={\n			id:0,\n			status_name:\"\",\n			name:\"未关联\",\n			workTimeList:[]\n		}\n		storyList.add(otherStory)\n		for(var k in workTimeMap){\n			var target=workTimeMap[k];\n			otherStory[\'workTimeList\'].push(target);\n		}\n		//\n		for(var i=0;i<storyList.length;i++){\n			var story=storyList[i];\n			story[\'allList\']=[];\n			for(var k=0;k<story[\'workTimeList\'].length;k++){\n				var innerList=story[\'workTimeList\'][k];\n				for(j=0;j<innerList.list.length;j++){\n					story[\'allList\'].push(innerList.list[j])\n				}\n			}\n		}\n		return storyList;\n	}\n}\n', '以需求维度统计成员工时', '{\"query\":[{\"name\":\"项目\",\"type\":\"project\"}]}', 2, 3, '2019-05-31 17:19:43', '2019-07-22 17:07:19');
INSERT INTO `t_data_table` (`id`, `company_id`, `name`, `group`, `roles`, `enable_role`, `status`, `is_delete`, `script`, `remark`, `data_table_define`, `create_account_id`, `update_account_id`, `create_time`, `update_time`) VALUES (5, 1, '成员任务日历', '默认', '[1,11]', 1, 1, 0, 'var dataTable={\n    query:[\n		{name:\"项目\",type:\"project\"},\n		{name:\"部门名称\",type:\"text\"},\n    ],\n    execute(){\n        var d=new Date();\n        var year=d.getFullYear();\n        var month=d.getMonth()+1;\n        if(month>=10){\n            month=year+\'-\'+month;\n        }else{\n            month=year+\'-0\'+month;\n        }\n        //$.info(month)\n        //\n        var departmentName=$.param(\'部门名称\');\n        if(!departmentName){\n            $.error(\'请输入部门名称\')\n            return;\n        }\n        //\n		var sheet=$.createSheet();\n        var maxCol=33;\n		sheet.name=\'成员任务日历\'+month\n		for(var i=0;i<maxCol;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=100;\n		sheet.col[1].width=100;\n        for(var i=0;i<31;i++){\n            sheet.col[i+2].width=100;\n        }\n		var header0=$.arrayToRow([\'成员任务日历\'+month]);\n		header0.cells[0].colspan=maxCol;\n		header0.cells[0].align=\'center\';\n		header0.cells[0].fsize=20;\n		sheet.header.add(header0);\n        //\n        var header=[\'姓名\',\'部门\'];\n        for(var i=1;i<=31;i++){\n            header.push(i+\"号\")\n        }\n        //\n        var row=$.arrayToRow(header);\n        for(var i=0;i<maxCol;i++){\n            row.cells[i].bgcolor=\"8EE5EE\"\n        }\n        //row.cells[2].colspan=31;\n        //row.cells[2].align=\'center\';\n		//row.cells[2].fsize=20;\n        sheet.body.add(row);\n        //\n        var accountList=this.getAccountList(departmentName);\n        var taskList=this.getTaskList(month);\n        var taskMap={};\n        for (i = 0; i < taskList.size(); i++) {\n            var task=taskList.get(i);\n            var ownerAccountIdList=task[\'owner_account_id_list\']\n            ownerAccountIdList=ownerAccountIdList.replace(\'[\',\'\')\n            ownerAccountIdList=ownerAccountIdList.replace(\']\',\'\')\n            ownerAccountIdList=ownerAccountIdList.split(\",\")\n            for(var j=0;j<ownerAccountIdList.length;j++){\n                var ownerAccountId=ownerAccountIdList[j];\n                if(!taskMap[ownerAccountId]){\n                    taskMap[ownerAccountId]=[];\n                    \n                } \n                taskMap[ownerAccountId].push(task);\n            }\n        }\n        for (i = 0; i < accountList.size(); i++) {\n            var account=accountList[i];\n            var taskList=taskMap[account[\'account_id\']];\n            var cols=[account[\'account_name\'],account[\'department_name\']];\n            for(var d=1;d<=31;d++){\n                var taskNames=\'\';\n                if(taskList){\n                    for (t = 0; t < taskList.length; t++) {\n                        var task=taskList[t];\n                        var isFinish=task[\'is_finish\']\n                        if(isFinish){\n                            if(d>=task[\'start_day\']&&d<=task[\'finish_day\']){\n                                taskNames=taskNames+task[\'task_name\']\n                                taskNames=taskNames+\'\\n\';\n                            }\n                        }else{\n                            if(d>=task[\'start_day\']&&d<=task[\'end_day\']){\n                                taskNames=taskNames+task[\'task_name\']\n                                taskNames=taskNames+\'\\n\';\n                            }\n                        }\n                        \n                    }\n                }\n                cols.push(taskNames)\n            }\n            row=$.arrayToRow(cols);\n            sheet.body.add(row);\n        }\n        //\n        $.table.sheets.add(sheet)\n	},\n    addTaskList(sheet,objectType,maxCol,startDate,endDate){\n        var taskList=this.getTaskList($.query.projectId,objectType,startDate,endDate)\n		for (i = 0; i < taskList.size(); i++) { \n			var task=taskList.get(i);\n            var row=$.arrayToRow([task[\'id\'],task[\'object_type_name\'],task[\'name\'],\n                task[\'priority_name\'],task[\'status_name\'],\n                $.fmtDate(task[\'start_date\']),$.fmtDate(task[\'end_date\'])],maxCol);\n            sheet.body.add(row);\n        }\n    },\n    getAccountList(departmentName){\n        var sql=`\n        select distinct(i2.id) as account_id,i2.name as account_name,i1.name as department_name from t_department a \ninner join t_department i1 on i1.id=a.parent_id\ninner join t_account i2 on i2.id=a.account_id\nwhere a.type=2 and i1.name=? order by i2.id asc;\n        `\n        var ArrayList = Java.type(\"java.util.ArrayList\")\n        var values = new ArrayList()\n        values.add(departmentName);\n        var accountList=$.queryList(sql,values);\n        //$.info(accountList)\n        return accountList;\n    },\n	getTaskList(month){\n		var sql=`select a.id as task_id,\n        concat(\'#\',a.serial_no,\' \',a.name) as task_name,\n        DATE_FORMAT(a.start_date, \'%e\') as start_day,\n        DATE_FORMAT(a.end_date, \'%e\') as end_day,\n        a.is_finish,\n        DATE_FORMAT(a.finish_time, \'%e\') as finish_day,\n        a.owner_account_id_list\n        from t_task a\nwhere 1=1  and a.is_delete=false and start_date is not null \n        and DATE_FORMAT(start_date, \'%Y-%m\')=? \n        and DATE_FORMAT(end_date, \'%Y-%m\')=? \n        and JSON_LENGTH(a.owner_account_id_list)>=1 \n        `;\n        var ArrayList = Java.type(\"java.util.ArrayList\")\n        var values = new ArrayList()\n        if($.query.projectId){\n			sql=sql+\' and a.project_id=\'+$.query.projectId;\n		}\n        if($.query.iterationId){\n			sql=sql+\' and a.iteration_id=\'+$.query.iterationId;\n		}\n        values.add(month);\n        values.add(month);\n        sql=sql+\' order by a.create_time\';\n		var taskList=$.queryList(sql,values)\n        //$.info(taskList)\n        return taskList;\n		\n	}\n}\n\n', '查看成员本月每天的任务安排', '{\"query\":[{\"name\":\"项目\",\"type\":\"project\"},{\"name\":\"部门名称\",\"type\":\"text\"}]}', 3, 3, '2020-02-17 09:46:43', '2020-04-23 10:39:41');
INSERT INTO `t_data_table` (`id`, `company_id`, `name`, `group`, `roles`, `enable_role`, `status`, `is_delete`, `script`, `remark`, `data_table_define`, `create_account_id`, `update_account_id`, `create_time`, `update_time`) VALUES (6, 1, '冒烟测试报告', '默认', '[]', 0, 1, 0, 'var dataTable={\n    query:[\n		{name:\"项目\",type:\"project\"}\n    ],\n    execute(){\n		//\n		var priorityNames=this.getPriorityNames();\n		var totalTestCaseNum=this.getTotalTestCases();\n		var executeTestCaseNum=this.getExecuteTestCases();\n		var executeRate=\'-\';\n		if(totalTestCaseNum>0){\n			executeRate=(executeTestCaseNum*100/totalTestCaseNum).toFixed(0)+\'%\';\n		}\n		var testCasePass=false;\n		if(executeTestCaseNum==totalTestCaseNum){\n			testCasePass=true;\n		}\n		//\n		var totalBugMap=this.getTotalBugNums(priorityNames);\n		var unfinishBugMap=this.getUnfinishBugNums(priorityNames);\n		var gaoBugs=unfinishBugMap[\'高\']\n		var gaoBugsPass=false;\n		if(gaoBugs==0){\n			gaoBugsPass=true;\n		}\n		//\n		var unfinishBugs=this.getUnfinishBugs();\n		//\n		var sheet=$.createSheet();\n		sheet.name=\'冒烟测试报告\'\n		for(var i=0;i<7;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=200;\n		sheet.col[1].width=150;\n		sheet.col[2].width=300;\n		sheet.col[3].width=100;\n		sheet.col[4].width=100;\n		sheet.col[5].width=100;\n		sheet.col[6].width=150;\n		var maxCol=7;\n		var header0=$.arrayToRow([this.getProjectName()+\'-冒烟测试报告\']);\n		header0.cells[0].colspan=maxCol;\n		header0.cells[0].align=\'center\';\n		header0.cells[0].fsize=20;\n		sheet.header.add(header0)\n		//\n		var row=$.arrayToRow([\'测试时间：\',\'开始时间-结束时间\'],maxCol);\n		row.cells[1].type=\'input\'\n		sheet.body.add(row);\n		row=$.arrayToRow([\'测试人员：\',\'待填写\'],maxCol)\n		row.cells[1].type=\'input\'\n		sheet.body.add(row);\n		//\n		sheet.body.add($.arrayToRow([\'\'],maxCol));\n		sheet.body.add($.arrayToRow([\'一、	测试结论\'],maxCol));\n		//\n		if(testCasePass&&gaoBugsPass){\n			sheet.body.add($.arrayToRow([\'本次测试符合冒烟测试过程的出口标准，冒烟测试过程结束\'],maxCol));\n		}else{\n			sheet.body.add($.arrayToRow([\'本次测试不符合冒烟测试过程的出口标准\'],maxCol));\n		}\n		sheet.body.add($.arrayToRow([\'风险分析/说明：\'],maxCol));\n		row=$.arrayToRow([\'描述本测试阶段的风险分析内容\'],maxCol)\n		row.cells[0].type=\'input\'\n		sheet.body.add(row);\n		//\n		sheet.body.add($.arrayToRow([\'\'],maxCol));\n		sheet.body.add($.arrayToRow([\'二、	测试出口标准\'],maxCol));\n		//\n		sheet.body.add($.arrayToRow([\'指标\',\'计算公式\',\'指标要求\',\'达成值\',\'状态\'],maxCol));\n		sheet.body.add($.arrayToRow([\'测试用例执行率（%）\',\'已执行用例数/总用例数\',\'100%\',executeRate,testCasePass?\'达成\':\'未达成\'],maxCol));\n		sheet.body.add($.arrayToRow([\'高优先级缺陷留存数\',\'未修复的高优先级缺陷\',\'0\',gaoBugs,gaoBugsPass?\'达成\':\'未达成\'],maxCol));\n		//\n		sheet.body.add($.arrayToRow([\'\'],maxCol));\n		sheet.body.add($.arrayToRow([\'三、	缺陷分析\'],maxCol));\n		sheet.body.add($.arrayToRow([\'1、缺陷统计\'],maxCol));\n		sheet.body.add($.arrayToRow([\'指标/优先级\'].concat(priorityNames),maxCol));\n		var items=[];\n		items[0]=\'发现缺陷个数\';\n		for(var i=0;i<priorityNames.size();i++){\n			var item=priorityNames.get(i);\n			items[i+1]=totalBugMap[item];\n		}\n		sheet.body.add($.arrayToRow(items,maxCol));\n		//\n		items=[];\n		items[0]=\'未关闭缺陷个数\';\n		for(var i=0;i<priorityNames.size();i++){\n			var item=priorityNames.get(i);\n			items[i+1]=unfinishBugMap[item];\n		}\n		sheet.body.add($.arrayToRow(items,maxCol));\n		sheet.body.add($.arrayToRow([\'2、未关闭缺陷分析\'],maxCol));\n		sheet.body.add($.arrayToRow([\'序号\',\'缺陷编号\',\'缺陷标题\',\'优先级\',\'缺陷状态\',\'上报人员\',\'责任人\'],maxCol));\n		//\n		items=[];\n		for(var i=0;i<unfinishBugs.size();i++){\n			var bug=unfinishBugs.get(i);\n			items[0]=i+1;\n			items[1]=bug[\'serial_no\']\n			items[2]=bug[\'name\']\n			items[3]=bug[\'priority_name\']\n			items[4]=bug[\'status_name\']\n			items[5]=bug[\'create_account_name\']\n			var ownerAccountList=bug[\'owner_account_list\']\n			if(ownerAccountList!=null&&ownerAccountList.length>0){\n				var jsonArray=JSON.parse(ownerAccountList);\n				var owner=\'\';\n				for(var j=0;j<jsonArray.length;j++){\n					owner+=jsonArray[j].name;\n					if(j<jsonArray.length-1){\n						owner+=\',\'\n					}\n				}\n			}\n			items[6]=owner\n			sheet.body.add($.arrayToRow(items,maxCol));\n		}\n		//\n		sheet.body.add($.arrayToRow([\'\'],maxCol));\n		sheet.body.add($.arrayToRow([\'四、	测试环境\'],maxCol));\n		row=$.arrayToRow([\'请补充测试环境\'],maxCol);\n		row.cells[0].type=\'input\'\n		sheet.body.add(row);\n		//\n		$.table.sheets.add(sheet)\n	},\n	getProjectName(){\n		if($.query.projectId){\n			var sql=\'select name from t_project where id=\'+$.query.projectId;\n			return $.queryForString(sql)\n		}\n		$.error(\'请选择项目\')\n	},\n	getPriorityNames(){\n		if($.query.projectId){\n			var sql=\'select name from t_project_priority_define where project_id=\'+$.query.projectId+\' and object_type=2 order by sort_weight asc;\';\n			return $.queryForStrings(sql)\n		}\n		$.error(\'请选择项目\')\n	},\n	getTotalBugNums(prioritys){\n		if($.query.projectId){\n			var sql=`select i2.name,count(1) as count from t_task a \ninner join t_object_type i1 on a.object_type=i1.id\ninner join t_project_priority_define i2 on a.priority=i2.id\ninner join t_project_status_define i3 on a.status=i3.id\nwhere a.project_id=? and a.is_delete=false and a.object_type=2\ngroup by i2.name;`\n			var objectList=$.queryList(sql,[$.query.projectId])\n			var ret={};\n			for (var index = 0; index < prioritys.length; index++) {\n				var priority=prioritys[index];\n				ret[priority]=0\n				for(var i=0;i<objectList.size();i++){\n					var item=objectList.get(i);\n					if(item[\'name\']==priority){\n						ret[priority]=item[\'count\']\n						break\n					}\n				}\n			}\n			//$.info(\'getTotalBugNums:\'+$.toJson(ret))\n			return ret; \n		}\n		$.error(\'请选择项目\')\n	},\n	getUnfinishBugNums(prioritys){\n		if($.query.projectId){\n			var sql=`select i2.name,count(1) as count from t_task a \ninner join t_object_type i1 on a.object_type=i1.id\ninner join t_project_priority_define i2 on a.priority=i2.id\ninner join t_project_status_define i3 on a.status=i3.id\nwhere a.project_id=? and a.is_delete=false and a.is_finish=false and a.object_type=2\ngroup by i2.name;`\n			var objectList=$.queryList(sql,[$.query.projectId])\n			var ret={};\n			for (var index = 0; index < prioritys.length; index++) {\n				var priority=prioritys[index];\n				ret[priority]=0\n				for(var i=0;i<objectList.size();i++){\n					var item=objectList.get(i);\n					if(item[\'name\']==priority){\n						ret[priority]=item[\'count\']\n						break\n					}\n				}\n			}\n			//$.info(\'getUnfinishBugNums:\'+$.toJson(ret))\n			return ret; \n		}\n		$.error(\'请选择项目\')\n	},\n	getTotalTestCases(){\n		if($.query.projectId){\n			var sql=`select count(1) from t_task a \nwhere a.project_id=? and a.is_delete=false and a.object_type=5;`\n			return $.queryCount(sql,[$.query.projectId])\n		}\n		$.error(\'请选择项目\')\n	},\n	getExecuteTestCases(){\n		if($.query.projectId){\n			var sql=`select count(1) from t_task a \nwhere a.project_id=? \nand a.is_delete=false \nand a.object_type=5\nand a.id in(select distinct(test_case_id) from t_test_plan_test_case where project_id=? and status>1)\n`\n			return $.queryCount(sql,[$.query.projectId,$.query.projectId])\n		}\n		$.error(\'请选择项目\')\n	},\n	getUnfinishBugs(){\n		if($.query.projectId){\n			var sql=`\n				select a.serial_no,a.name,i2.name as priority_name,i3.name as status_name,i4.name as create_account_name,a.owner_account_list from t_task a \ninner join t_object_type i1 on a.object_type=i1.id\ninner join t_project_priority_define i2 on a.priority=i2.id\ninner join t_project_status_define i3 on a.status=i3.id\ninner join t_account i4 on a.create_account_id=i4.id\nwhere a.project_id=? and a.is_delete=false and a.is_finish=false and a.object_type=2;\n`\n			return $.queryList(sql,[$.query.projectId])\n		}\n		$.error(\'请选择项目\')\n	}\n}\n', '对软件基本功能进行确认验证', '{\"query\":[{\"name\":\"项目\",\"type\":\"project\"}]}', 3, 3, '2019-07-08 16:31:50', '2020-02-06 11:59:46');
INSERT INTO `t_data_table` (`id`, `company_id`, `name`, `group`, `roles`, `enable_role`, `status`, `is_delete`, `script`, `remark`, `data_table_define`, `create_account_id`, `update_account_id`, `create_time`, `update_time`) VALUES (7, 1, '成员项目统计', '默认', '[1,10]', 1, 1, 0, 'var dataTable={\n    query:[\n        {name:\"成员姓名\",type:\"text\"}\n    ],\n    execute(){\n		var userName=$.param(\'成员姓名\');\n		if(userName==null||userName==\'\'){\n			$.error(\'请输入成员姓名\');\n			return;\n		}\n		this.queryTaskProjectStat(userName);\n	},\n	queryTaskProjectStat(userName){\n		var sheet=$.createSheet();\n		sheet.name=\'项目统计\'\n		for(var i=0;i<4;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=200;\n		sheet.col[1].width=100;\n		sheet.col[2].width=100;\n		sheet.col[3].width=400;\n\n		var row=$.arrayToRow([\'项目名称\',\'已办数量\'])\n		sheet.header.add(row)\n		\n\n		var sql=`\n		select i1.id,i3.name as project_name,i1.name as account_name,count(1) as num from t_task a \ninner join t_task_owner i0 on a.id=i0.task_id\ninner join t_account i1 on i0.account_id=i1.id\ninner join t_project_module i2 on i2.object_type=a.object_type and i2.project_id=a.project_id\ninner join t_project i3 on i3.id=a.project_id\nwhere a.is_delete=false and a.is_finish=true and i2.is_status_based=true and i3.status=1 and i1.name=?\ngroup by i1.id,i3.id\norder by num desc;\n		`\n		var stat=$.queryList(sql,[userName])\n		for (i = 0; i < stat.size(); i++) { \n			var item=stat[i];\n			sheet.body.add($.mapToRow(item,[\'project_name\',\'num\'],{}))\n		}\n		//\n		var chart=$.createChart();\n        chart.title=\"项目数量\";\n        chart.height=400;\n        chart.cellRange.x1=0;\n        chart.cellRange.x2=1;\n        chart.cellRange.y1=0;\n        chart.cellRange.y2=stat.size()-1;\n        //\n        chart.xAxis.index=0;\n        chart.xAxis.type=\'category\';\n        //\n        chart.yAxis.type=\'value\';\n        //\n        var series1=$.createSeries();\n        series1.index=1;\n        series1.name=\"数量\";\n        series1.type=\"pie\";\n        chart.series.add(series1);\n        //\n        var row=$.arrayToRow([$.toJson(chart)])\n        row.cells[0].type=\'chart\';\n        row.cells[0].colspan=3;\n        sheet.body.add(row);\n		//\n		//\n		$.table.sheets.add(sheet);\n	}\n}\n', '查看成员已完成统计', '{\"query\":[{\"name\":\"成员姓名\",\"type\":\"text\"}]}', 3, 3, '2019-07-10 11:10:15', '2020-01-23 19:26:10');
INSERT INTO `t_data_table` (`id`, `company_id`, `name`, `group`, `roles`, `enable_role`, `status`, `is_delete`, `script`, `remark`, `data_table_define`, `create_account_id`, `update_account_id`, `create_time`, `update_time`) VALUES (8, 1, '项目周报', '默认', '[1,11]', 1, 1, 0, 'function getMonday(){\n    var d = new Date();\n    d.setHours(0, 0, 0, 0);\n    var day = d.getDay(),\n    diff = d.getDate() - day + (day == 0 ? -6:1);\n    return new Date(d.setDate(diff));\n}\nfunction getSunday(){\n    var d = new Date();\n    d.setHours(0, 0, 0, 0);\n    var day = d.getDay(),\n    diff = d.getDate() - day + (day == 0 ? 0:7);\n    return new Date(d.setDate(diff));\n}\nvar dataTable={\n    query:[\n		{name:\"项目\",type:\"project\"},\n        {name:\"开始时间\",type:\"date\",value:getMonday()},\n        {name:\"结束时间\",type:\"date\",value:getSunday()}\n    ],\n    execute(){\n        var startDate=$.query.parameters.开始时间;\n        var endDate=$.query.parameters.结束时间;\n        if(startDate==null){\n            $.error(\'请输入开始时间\')\n            return;\n        }\n        if(endDate==null){\n            $.error(\'请输入结束时间\')\n            return;\n        }\n		var sheet=$.createSheet();\n		sheet.name=\'项目周报\'\n		for(var i=0;i<7;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=200;\n		sheet.col[1].width=200;\n		sheet.col[2].width=200;\n		sheet.col[3].width=200;\n		sheet.col[4].width=100;\n		sheet.col[5].width=100;\n		sheet.col[6].width=150;\n		var maxCol=7;\n        var project=this.getProject();\n        var createTime=$.fmtDate(project.create_time);\n        var projectEndDate=$.fmtDate(project.end_date);\n        var projectName=project.name;\n        var workflowStatusName=project.work_flow_status_name;\n        var runLogRemark=project.run_log_remark;\n        var progress=project.progress;\n        var runStatus=project.run_status;\n        var runStatusName=\"\";\n        if(runStatus==1){\n            runStatusName=\"进度正常\";\n        }else if(runStatus==2){\n            runStatusName=\"存在风险\";\n        }else if(runStatus==3){\n            runStatusName=\"进度失控\";\n        }\n        var ownerAccountNames=\"\";\n        if(!!project.owner_account_list){\n            var accountList = JSON.parse(project.owner_account_list);\n            if(!!accountList&&accountList.length>0){\n                for(var i=0;i<accountList.length;i++){\n                    ownerAccountNames+=accountList[i].name+\" \";\n                }\n            }\n        }\n		var header0=$.arrayToRow([projectName+\'-项目周报\']);\n		header0.cells[0].colspan=maxCol;\n		header0.cells[0].align=\'center\';\n		header0.cells[0].fsize=20;\n		sheet.header.add(header0);\n        //\n        var row=$.arrayToRow([\'一、项目概述\'],maxCol);\n        sheet.body.add(row);\n        //\n        var row=$.arrayToRow([\'项目名称\',projectName,\'项目整体周期\',createTime+\' ~ \'+projectEndDate],maxCol);\n        sheet.body.add(row);\n        //\n		row=$.arrayToRow([\'项目负责人\',ownerAccountNames,\'本次汇报周期\',$.fmtDate($.toDate(startDate))+\' ~ \'+$.fmtDate($.toDate(endDate))],maxCol)\n		//row.cells[1].type=\'input\'\n        //row.cells[1].bgcolor=\'FF0000\';\n        //row.cells[3].type=\'input\'\n        //row.cells[3].bgcolor=\'FF0000\';\n		sheet.body.add(row);\n        var row=$.arrayToRow([\'项目工作流状态\',workflowStatusName,\'项目状态\',runStatusName],maxCol);\n        sheet.body.add(row);\n        //\n        var row=$.arrayToRow([\'项目进度百分比\',progress+\'%\'],maxCol);\n        sheet.body.add(row);\n        //\n        var row=$.arrayToRow([\'问题/风险描述\',runLogRemark],maxCol);\n        sheet.body.add(row);\n        var row=$.arrayToRow([\'\'],maxCol);\n        sheet.body.add(row);\n         var row=$.arrayToRow([\'二、汇报说明\'],maxCol);\n        sheet.body.add(row);\n        var row=$.arrayToRow([\'项目目标\',\'待填写\'],maxCol);\n        row.cells[1].type=\'input\'\n        sheet.body.add(row);\n         var row=$.arrayToRow([\'项目进度说明\',\'待填写\'],maxCol);\n        row.cells[1].type=\'input\'\n        sheet.body.add(row);\n		//\n		var row=$.arrayToRow([\'\'],maxCol);\n        sheet.body.add(row);\n        //\n        var row=$.arrayToRow([\'三、本周具体执行任务\'],maxCol);\n        sheet.body.add(row);\n        //\n        var row=$.arrayToRow([\'ID\',\'类型\',\'名称\',\'优先级\',\'状态\',\'开始时间\',\'截止时间\'],maxCol);\n        sheet.body.add(row);\n        //\n        this.addTaskList(sheet,maxCol,startDate,endDate);\n        //\n		$.table.sheets.add(sheet)\n	},\n    addTaskList(sheet,maxCol,startDate,endDate){\n        var taskList=this.getTaskList($.query.projectId,startDate,endDate)\n		for (i = 0; i < taskList.size(); i++) {\n			var task=taskList.get(i);\n            var row=$.arrayToRow([\'#\'+task[\'serial_no\'],task[\'object_type_name\'],task[\'name\'],\n                task[\'priority_name\'],task[\'status_name\'],\n                $.fmtDate(task[\'start_date\']),$.fmtDate(task[\'end_date\'])],maxCol);\n            sheet.body.add(row);\n        }\n    },\n	getProject(){\n		if($.query.projectId){\n			var sql=\'select t.*,t1.name work_flow_status_name from t_project t left join t_project_status_define t1 on t.workflow_status=t1.id  where t.id=\'+$.query.projectId;\n			return $.queryForObject(sql)\n		}\n		$.error(\'请选择项目\')\n	},\n	getTaskList(projectId,startDate,endDate){\n		var sql=`select a.serial_no,i1.name as object_type_name,a.name,i2.name as priority_name,i3.name as status_name,a.start_date,a.end_date from t_task a\ninner join t_object_type i1 on a.object_type=i1.id\ninner join t_project_priority_define i2 on a.priority=i2.id\ninner join t_project_status_define i3 on a.status=i3.id\nwhere a.project_id=? and a.is_delete=false `;\n        var ArrayList = Java.type(\"java.util.ArrayList\")\n        var values = new ArrayList()\n        values.add(projectId)\n        if($.query.iterationId){\n			sql=sql+\' and a.iteration_id=\'+$.query.iterationId;\n		}\n        sql=sql+` and(\n                    (   (a.start_date>=? or (a.start_date is null and DATE_FORMAT(a.create_time, \'%Y-%m-%d\')>=?))\n                            and a.start_date<=?\n                    )\n                    or\n                    (   a.end_date>=? and a.end_date<=?\n                    )\n                    or\n                    (   a.start_date<=? and a.end_date>=?\n                    )\n                    or (a.finish_time is not null and DATE_FORMAT(a.finish_time, \'%Y-%m-%d\')>=? and DATE_FORMAT(a.finish_time, \'%Y-%m-%d\')<=?)\n                )`;\n        values.add($.toDate(startDate));\n        values.add($.toDate(startDate));\n        values.add($.toDate(endDate));\n        values.add($.toDate(startDate));\n        values.add($.toDate(endDate));\n        values.add($.toDate(startDate));\n        values.add($.toDate(endDate))\n        values.add($.toDate(startDate));\n        values.add($.toDate(endDate));\n        sql=sql+\' order by a.object_type,a.status,a.create_time\';\n		var taskList=$.queryList(sql,values)\n        return taskList;\n	}\n}', '查看项目周报', '{\"query\":[{\"name\":\"项目\",\"type\":\"project\"},{\"name\":\"开始时间\",\"type\":\"date\",\"value\":1581264000000},{\"name\":\"结束时间\",\"type\":\"date\",\"value\":1581782400000}]}', 3, 3, '2020-01-22 19:36:51', '2021-05-24 17:11:50');
INSERT INTO `t_data_table` (`id`, `company_id`, `name`, `group`, `roles`, `enable_role`, `status`, `is_delete`, `script`, `remark`, `data_table_define`, `create_account_id`, `update_account_id`, `create_time`, `update_time`) VALUES (9, 1, '个人工作周报', '默认', '[]', 0, 1, 0, 'function getMonday(){\n    var d = new Date();\n    d.setHours(0, 0, 0, 0);\n    var day = d.getDay(),\n    diff = d.getDate() - day + (day == 0 ? -6:1);\n    return new Date(d.setDate(diff));\n}\nfunction getSunday(){\n    var d = new Date();\n    d.setHours(0, 0, 0, 0);\n    var day = d.getDay(),\n    diff = d.getDate() - day + (day == 0 ? 0:7);\n    return new Date(d.setDate(diff));\n}\nvar dataTable={\n    query:[\n		{name:\"项目\",type:\"project\"},\n        {name:\"开始时间\",type:\"date\",value:getMonday()},\n        {name:\"结束时间\",type:\"date\",value:getSunday()}\n    ],\n    execute(){\n        var startDate=$.param(\'开始时间\');\n        var endDate=$.param(\'结束时间\');\n        if(startDate==null){\n            $.error(\'请输入开始时间\')\n            return;\n        }\n        if(endDate==null){\n            $.error(\'请输入结束时间\')\n            return;\n        }\n        var accountId=$.account.id;\n		var sheet=$.createSheet();\n        var maxCol=9;\n		sheet.name=\'个人工作周报\'\n		for(var i=0;i<maxCol;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=100;\n		sheet.col[1].width=200;\n		sheet.col[2].width=50;\n		sheet.col[3].width=50;\n		sheet.col[4].width=100;\n		sheet.col[5].width=100;\n		sheet.col[6].width=100;\n		sheet.col[7].width=250;\n		sheet.col[8].width=200;\n        \n		var header0=$.arrayToRow([\'个人工作周报\']);\n		header0.cells[0].colspan=maxCol;\n		header0.cells[0].align=\'center\';\n		header0.cells[0].fsize=20;\n		sheet.header.add(header0);\n        //\n        var departmentName=this.getAccountDepartment(accountId);\n        var strStartDate=$.fmtDate($.toDate(startDate));\n        var strEndDate=$.fmtDate($.toDate(endDate));\n        var row=$.arrayToRow([departmentName+\'-\'+$.account.name+\'-\'+strStartDate+\'-\'+strEndDate],1);\n        row.cells[0].colspan=maxCol;\n        row.cells[0].align=\'right\';\n        sheet.body.add(row);\n        //\n        row=$.arrayToRow([\'项目\',\'名称\',\'类型\',\'状态\',\'开始时间\',\'结束时间\',\'完成时间\',\'描述\',\'工作内容\']);\n        sheet.body.add(row);\n        for(var i=0;i<maxCol;i++){\n            row.cells[i].bgcolor=\"8EE5EE\"\n        }\n        //\n        var taskList=this.getTaskList(accountId,startDate,endDate)\n        var taskMap = {};\n        for(j = 0; j < taskList.length; j++) {\n            var task=taskList[j];\n            var key=task[\'project_name\'];\n            taskMap[key] = taskMap[key] || [];\n            taskMap[key].push(task);   \n        }\n        for(var projectName in taskMap){\n            var tList=taskMap[projectName];\n            var t=tList[0];\n            row=$.arrayToRow([projectName,t[\'task_name\'],t[\'object_type_name\'],t[\'task_status_name\'],\n                $.fmtDate(t[\'start_date\']),$.fmtDate(t[\'end_date\']),$.fmtDate(t[\'finish_time\']),\n                $.cleanHtml(t[\'content\']),$.cleanHtml(t[\'comment\'])]);\n            sheet.body.add(row);\n            row.cells[0].rowspan=tList.length;\n            row.cells[6].type=\'input\'\n            row.cells[7].type=\'input\'\n            for(k = 1; k < tList.length; k++) {\n                var t=tList[k];\n                row=$.arrayToRow([t[\'task_name\'],t[\'object_type_name\'],t[\'task_status_name\'],\n                    $.fmtDate(t[\'start_date\']),$.fmtDate(t[\'end_date\']),$.fmtDate(t[\'finish_time\']),\n                    $.cleanHtml(t[\'content\']),$.cleanHtml(t[\'comment\'])]);\n                row.cells[5].type=\'input\'\n                row.cells[6].type=\'input\'\n                sheet.body.add(row);\n            }\n        }\n        //\n		$.table.sheets.add(sheet)\n	},\n    addTaskList(sheet,objectType,maxCol,startDate,endDate){\n        var taskList=this.getTaskList($.query.projectId,objectType,startDate,endDate)\n		for (i = 0; i < taskList.size(); i++) { \n			var task=taskList.get(i);\n            var row=$.arrayToRow([task[\'id\'],task[\'object_type_name\'],task[\'name\'],\n                task[\'priority_name\'],task[\'status_name\'],\n                $.fmtDate(task[\'start_date\']),$.fmtDate(task[\'end_date\'])],maxCol);\n            sheet.body.add(row);\n        }\n    },\n    getAccountDepartment(accountId){\n		var sql=`select JSON_UNQUOTE(JSON_EXTRACT(a.department_list,\'$[0].name\')) \n        from t_company_member a \n        inner join t_account i1 on a.account_id=i1.id\n        where i1.id=?\n        ;`;\n		return $.queryForString(sql,[accountId])\n	},\n	getTaskList(accountId,startDate,endDate){\n		var sql=`select i1.name as project_name,a.id as task_id,\n        concat(\'#\',a.serial_no,\' \',a.name) as task_name,i6.name as object_type_name,\n        i7.name as task_status_name,a.start_date,a.end_date,a.finish_time,i2.content,b.comment \n        from t_task a\ninner join t_project i1 on a.project_id=i1.id\ninner join t_task_description i2 on a.id=i2.task_id\ninner join t_account i4 on a.create_account_id=i4.id\ninner join t_object_type i6 on a.object_type=i6.id\ninner join t_project_status_define i7 on a.status=i7.id\nleft join(\n	select * from t_task_comment l1 where l1.id in(\n		select max(l2.id) from t_task_comment l2 where l2.is_delete=false group by l2.task_id\n	)\n)b on a.id=b.task_id\nwhere 1=1  and a.is_delete=false `;\n        var ArrayList = Java.type(\"java.util.ArrayList\")\n        var values = new ArrayList()\n        if($.query.projectId){\n			sql=sql+\' and a.project_id=\'+$.query.projectId;\n		}\n        if($.query.iterationId){\n			sql=sql+\' and a.iteration_id=\'+$.query.iterationId;\n		}\n        sql=sql+` and(  \n                    (   (a.start_date>=? or (a.start_date is null and DATE_FORMAT(a.create_time, \'%Y-%m-%d\')>=?)) \n                            and a.start_date<=?\n                    )\n                    or \n                    (   a.end_date>=? and a.end_date<=?\n                    )\n                    or \n                    (   a.start_date<=? and a.end_date>=?\n                    )\n                    or (a.finish_time is not null and DATE_FORMAT(a.finish_time, \'%Y-%m-%d\')>=? and DATE_FORMAT(a.finish_time, \'%Y-%m-%d\')<=?)\n                )`;\n        values.add($.toDate(startDate));\n        values.add($.toDate(startDate));\n        values.add($.toDate(endDate));\n        values.add($.toDate(startDate));\n        values.add($.toDate(endDate));\n        values.add($.toDate(startDate));\n        values.add($.toDate(endDate))\n        values.add($.toDate(startDate));\n        values.add($.toDate(endDate));\n        sql=sql+\" and json_contains(a.owner_account_id_list,\'\"+accountId+\"\')\";\n        sql=sql+\'order by a.project_id,a.object_type,a.status,a.create_time\';\n		var taskList=$.queryList(sql,values)\n        return taskList;\n		\n	}\n}\n\n', '查看个人工作周报', '{\"query\":[{\"name\":\"项目\",\"type\":\"project\"},{\"name\":\"开始时间\",\"type\":\"date\",\"value\":1582473600000},{\"name\":\"结束时间\",\"type\":\"date\",\"value\":1582992000000}]}', 3, 3, '2020-01-31 10:08:32', '2020-02-26 10:56:30');
INSERT INTO `t_data_table` (`id`, `company_id`, `name`, `group`, `roles`, `enable_role`, `status`, `is_delete`, `script`, `remark`, `data_table_define`, `create_account_id`, `update_account_id`, `create_time`, `update_time`) VALUES (12, 1, '部门待办事项', '默认', '[1]', 1, 1, 0, 'var dataTable={\n    query:[\n        {name:\"部门名称\",type:\"text\"},\n		{name:\"项目\",type:\"project\"},\n		{name:\"成员名称\",type:\"text\"}\n    ],\n    execute(){\n		var departmentName=$.param(\'部门名称\');\n		if(departmentName==null||departmentName==\'\'){\n			$.error(\'请输入部门名称\');\n			return;\n		}\n		var accountName=$.param(\'成员名称\');\n		this.queryTaskList(departmentName,accountName);\n		this.queryTaskProjectStat(departmentName,accountName);\n		this.queryTaskMemberStat(departmentName,accountName);\n		this.queryTaskStatusStat(departmentName,accountName);\n	},\n	queryTaskList(departmentName,accountName){\n		var sheet=$.createSheet();\n		sheet.name=\'待办列表\'\n		//\n		for(var i=0;i<7;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=60;\n		sheet.col[1].width=150;\n		sheet.col[2].width=60;\n		sheet.col[3].width=250;\n		sheet.col[4].width=80;\n		sheet.col[5].width=120;\n		sheet.col[6].width=120;\n		sheet.col[6].width=120;\n		//\n		var row=$.arrayToRow([\'姓名\',\'项目\',\'编号\',\'名称\',\'类型\',\'状态\',\'起始时间\',\'截止时间\'])\n		sheet.header.add(row)\n		var sql=`\n		select i1.name as account_name,i3.name as project_name,a.serial_no,a.name,i4.name as object_type_name,i5.name as status_name,a.start_date,a.end_date from t_task a \ninner join t_task_owner i0 on a.id=i0.task_id\ninner join t_account i1 on i0.account_id=i1.id\ninner join t_project_module i2 on i2.object_type=a.object_type and i2.project_id=a.project_id\ninner join t_project i3 on i3.id=a.project_id\ninner join t_object_type i4 on i4.id=a.object_type\ninner join t_project_status_define i5 on i5.id=a.status\ninner join t_department i6 on i6.account_id=i1.id\ninner join t_department i7 on i7.id=i6.parent_id\nwhere a.is_delete=false and a.is_finish=false and i2.is_status_based=true and i3.status=1 and i7.name=?\n		`\n		var ArrayList = Java.type(\"java.util.ArrayList\")\n        var values = new ArrayList()\n        values.add(departmentName);\n		if(accountName){\n			sql=sql+\' and i1.name=?\';\n			values.add(accountName)\n		}\n		if($.query.projectId){\n   			sql=sql+\' and a.project_id=\'+$.query.projectId;\n  		}\n        if($.query.iterationId){\n   			sql=sql+\' and a.iteration_id=\'+$.query.iterationId;\n  		}\n		sql=sql+\' order by i1.id,i5.name\';\n		var tasks=$.queryList(sql,values)\n		for (i = 0; i < tasks.size(); i++) { \n			var task=tasks.get(i);\n			var mapKey=[\n						\'account_name\',\n						\'project_name\',\n						\'serial_no\',\n						\'name\',\n						\'object_type_name\',\n						\'status_name\',\n						\'start_date\',\n						\'end_date\'];\n			sheet.body.add($.mapToRow(task,\n				mapKey,\n				{	\n					\'start_date\':\'fmtDate\',\n					\'end_date\':\'fmtDate\'\n				})\n			)\n		}\n		//\n		$.table.sheets.add(sheet);\n	},\n	queryTaskProjectStat(departmentName,accountName){\n		var sheet=$.createSheet();\n		sheet.name=\'项目统计\'\n		for(var i=0;i<4;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=200;\n		sheet.col[1].width=100;\n		sheet.col[2].width=100;\n		sheet.col[3].width=400;\n\n		var row=$.arrayToRow([\'项目名称\',\'待办数量\'])\n		sheet.header.add(row)\n		\n\n		var sql=`\n		select i3.name as project_name,count(1) as num from t_task a \ninner join t_task_owner i0 on a.id=i0.task_id\ninner join t_account i1 on i0.account_id=i1.id\ninner join t_project_module i2 on i2.object_type=a.object_type and i2.project_id=a.project_id\ninner join t_project i3 on i3.id=a.project_id\ninner join t_department i6 on i6.account_id=i1.id\ninner join t_department i7 on i7.id=i6.parent_id\nwhere a.is_delete=false and a.is_finish=false and i2.is_status_based=true and i3.status=1 and i7.name=? \n		`\n		var ArrayList = Java.type(\"java.util.ArrayList\")\n        var values = new ArrayList()\n        values.add(departmentName);\n		if(accountName){\n			sql=sql+\' and i1.name=?\';\n			values.add(accountName)\n		}\n		if($.query.projectId){\n   			sql=sql+\' and a.project_id=\'+$.query.projectId;\n  		}\n        if($.query.iterationId){\n   			sql=sql+\' and a.iteration_id=\'+$.query.iterationId;\n  		}\n		sql=sql+\' group by i3.id order by num desc\';\n		var stat=$.queryList(sql,values)\n		for (i = 0; i < stat.size(); i++) { \n			var item=stat[i];\n			sheet.body.add($.mapToRow(item,[\'project_name\',\'num\'],{}))\n		}\n		//\n		var chart=$.createChart();\n        chart.title=\"项目统计\";\n        chart.height=400;\n        chart.cellRange.x1=0;\n        chart.cellRange.x2=1;\n        chart.cellRange.y1=0;\n        chart.cellRange.y2=stat.size()-1;\n        //\n        chart.xAxis.index=0;\n        chart.xAxis.type=\'category\';\n        //\n        chart.yAxis.type=\'value\';\n        //\n        var series1=$.createSeries();\n        series1.index=1;\n        series1.name=\"数量\";\n        series1.type=\"pie\";\n        chart.series.add(series1);\n        //\n        var row=$.arrayToRow([$.toJson(chart)])\n        row.cells[0].type=\'chart\';\n        row.cells[0].colspan=3;\n        sheet.body.add(row);\n		//\n		//\n		$.table.sheets.add(sheet);\n	},\n	queryTaskMemberStat(departmentName,accountName){\n		var sheet=$.createSheet();\n		sheet.name=\'成员统计\'\n		for(var i=0;i<4;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=200;\n		sheet.col[1].width=100;\n		sheet.col[2].width=100;\n		sheet.col[3].width=400;\n\n		var row=$.arrayToRow([\'成员名称\',\'待办数量\'])\n		sheet.header.add(row)\n		var sql=`\n		select i1.name as account_name,count(1) as num from t_task a \ninner join t_task_owner i0 on a.id=i0.task_id\ninner join t_account i1 on i0.account_id=i1.id\ninner join t_project_module i2 on i2.object_type=a.object_type and i2.project_id=a.project_id\ninner join t_project i3 on i3.id=a.project_id\ninner join t_department i6 on i6.account_id=i1.id\ninner join t_department i7 on i7.id=i6.parent_id\nwhere a.is_delete=false and a.is_finish=false and i2.is_status_based=true \nand i3.status=1 and i7.name=? \n		`\n		var ArrayList = Java.type(\"java.util.ArrayList\")\n        var values = new ArrayList()\n        values.add(departmentName);\n		if(accountName){\n			sql=sql+\' and i1.name=?\';\n			values.add(accountName)\n		}\n		if($.query.projectId){\n   			sql=sql+\' and a.project_id=\'+$.query.projectId;\n  		}\n        if($.query.iterationId){\n   			sql=sql+\' and a.iteration_id=\'+$.query.iterationId;\n  		}\n		sql=sql+\' group by i1.id order by num desc\';\n		var stat=$.queryList(sql,values)\n		for (i = 0; i < stat.size(); i++) { \n			var item=stat[i];\n			sheet.body.add($.mapToRow(item,[\'account_name\',\'num\'],{}))\n		}\n		//\n		var chart=$.createChart();\n        chart.title=\"成员统计\";\n        chart.height=400;\n        chart.cellRange.x1=0;\n        chart.cellRange.x2=1;\n        chart.cellRange.y1=0;\n        chart.cellRange.y2=stat.size()-1;\n        //\n        chart.xAxis.index=0;\n        chart.xAxis.type=\'category\';\n        //\n        chart.yAxis.type=\'value\';\n        //\n        var series1=$.createSeries();\n        series1.index=1;\n        series1.name=\"数量\";\n        series1.type=\"pie\";\n        chart.series.add(series1);\n        //\n        var row=$.arrayToRow([$.toJson(chart)])\n        row.cells[0].type=\'chart\';\n        row.cells[0].colspan=3;\n        sheet.body.add(row);\n		//\n		//\n		$.table.sheets.add(sheet);\n	},\n	queryTaskStatusStat(departmentName,accountName){\n		var sheet=$.createSheet();\n		sheet.name=\'状态统计\'\n		for(var i=0;i<4;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=200;\n		sheet.col[1].width=100;\n		sheet.col[2].width=100;\n		sheet.col[3].width=400;\n\n		var row=$.arrayToRow([\'状态名\',\'数量\'])\n		sheet.header.add(row)\n		\n\n		var sql=`\n		select i5.name as status_name,count(1) as num from t_task a \ninner join t_task_owner i0 on a.id=i0.task_id\ninner join t_account i1 on i0.account_id=i1.id\ninner join t_project_module i2 on i2.object_type=a.object_type and i2.project_id=a.project_id\ninner join t_project i3 on i3.id=a.project_id\ninner join t_project_status_define i5 on i5.id=a.status\ninner join t_department i6 on i6.account_id=i1.id\ninner join t_department i7 on i7.id=i6.parent_id\nwhere a.is_delete=false and a.is_finish=false and i2.is_status_based=true and i3.status=1 and i7.name=?\n		`\n		var ArrayList = Java.type(\"java.util.ArrayList\")\n        var values = new ArrayList()\n        values.add(departmentName);\n		if(accountName){\n			sql=sql+\' and i1.name=?\';\n			values.add(accountName)\n		}\n		if($.query.projectId){\n   			sql=sql+\' and a.project_id=\'+$.query.projectId;\n  		}\n        if($.query.iterationId){\n   			sql=sql+\' and a.iteration_id=\'+$.query.iterationId;\n  		}\n		sql=sql+\' group by i5.name order by num desc\';\n		//\n		var stat=$.queryList(sql,values)\n		for (i = 0; i < stat.size(); i++) { \n			var item=stat[i];\n			sheet.body.add($.mapToRow(item,[\'status_name\',\'num\'],{}))\n		}\n		//\n		var chart=$.createChart();\n        chart.title=\"状态数量\";\n        chart.height=400;\n        chart.cellRange.x1=0;\n        chart.cellRange.x2=1;\n        chart.cellRange.y1=0;\n        chart.cellRange.y2=stat.size()-1;\n        //\n        chart.xAxis.index=0;\n        chart.xAxis.type=\'category\';\n        //\n        chart.yAxis.type=\'value\';\n        //\n        var series1=$.createSeries();\n        series1.index=1;\n        series1.name=\"数量\";\n        series1.type=\"bar\";\n        chart.series.add(series1);\n        //\n        var row=$.arrayToRow([$.toJson(chart)])\n        row.cells[0].type=\'chart\';\n        row.cells[0].colspan=3;\n        sheet.body.add(row);\n		//\n		//\n		$.table.sheets.add(sheet);\n	}\n}\n', '统计部门待办事项', '{\"query\":[{\"name\":\"部门名称\",\"type\":\"text\"},{\"name\":\"项目\",\"type\":\"project\"},{\"name\":\"成员名称\",\"type\":\"text\"}]}', 3, 3, '2020-03-11 12:03:32', '202