INSERT INTO `t_data_table` (`id`, `company_id`, `name`, `group`, `roles`, `enable_role`, `status`, `is_delete`, `script`, `remark`, `data_table_define`, `create_account_id`, `update_account_id`, `create_time`, `update_time`) VALUES (13, 1, '全局缺陷', '默认', '[1]', 1, 1, 0, 'var dataTable={\n    query:[\n        {name:\"开始时间\",type:\"date\"},\n        {name:\"结束时间\",type:\"date\"}\n    ],\n    execute:function(){\n        var startDate=$.query.parameters.开始时间;\n        var endDate=$.query.parameters.结束时间;\n        if(startDate==null){\n            $.error(\'请输入开始时间\')\n            return;\n        }\n        if(endDate==null){\n            $.error(\'请输入结束时间\')\n            return;\n        }\n		var sheet=$.createSheet();\n		sheet.name=\'全局缺陷列表\'\n        var maxCol=13;\n		for(var i=0;i<maxCol;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=80;\n		sheet.col[1].width=150;\n		sheet.col[2].width=200;\n		sheet.col[3].width=100;\n		sheet.col[4].width=100;\n		sheet.col[5].width=100;\n		sheet.col[6].width=150;\n        sheet.col[7].width=150;\n        sheet.col[8].width=150;\n        sheet.col[9].width=150;\n        sheet.col[10].width=150;\n        sheet.col[11].width=150;\n        sheet.col[12].width=150;\n       \n		      \n        var row=$.arrayToRow([\'ID\',\'项目名称\',\'缺陷名称\',\'优先级\',\'状态\',\'创建人\',\'责任人\',\'迭代\',\'预计工时\',\'已用工时\',\'开始时间\',\'截止时间\',\'完成时间\'],maxCol);\n        sheet.body.add(row);\n        //\n        this.addTaskList(sheet,maxCol,startDate,endDate);\n        //\n		$.table.sheets.add(sheet)\n	},\n    addTaskList:function(sheet,maxCol,startDate,endDate){\n        var taskList=this.getTaskList(startDate,endDate)\n		for (i = 0; i < taskList.size(); i++) { \n			var task=taskList.get(i);\n            var owners=JSON.parse(task[\"owner_account_list\"]);\n            var ownerNams=\"\";\n            \n            if(owners&&owners.length>0){\n                for(var j=0;j<owners.length;j++){\n                    ownerNams=ownerNams+owners[j].name;\n                    if(j!=owners.length-1){\n                        ownerNams=ownerNams+\",\"\n                    }\n                }\n            }\n            var row=$.arrayToRow([\'#\'+task[\'serial_no\'],task[\'project_name\'],task[\'name\'],\n                task[\'priority_name\'],task[\'status_name\'],task[\'create_account_name\'],ownerNams,\n                task[\'iteration_name\'], task[\'work_time\'],task[\'expect_work_time\'],\n                $.fmtDate(task[\'start_date\']),$.fmtDate(task[\'end_date\']),$.fmtDate(task[\'finish_time\'])],maxCol);\n            sheet.body.add(row);\n        }\n    },\n    getTaskList:function(startDate,endDate){\n		var sql=\"select a.serial_no,a.name,a.owner_account_list,a.finish_time,a.expect_work_time,a.work_time,a.start_date,a.end_date,i1.name as object_type_name,i2.name as priority_name,i3.name as status_name,i4.name as project_name,i5.name as create_account_name,i6.name as iteration_name from t_task a inner join t_object_type i1 on a.object_type=i1.id inner join t_project_priority_define i2 on a.priority=i2.id inner join t_project_status_define i3 on a.status=i3.id inner join t_project i4 on a.project_id=i4.id left join t_account i5 on a.create_account_id=i5.id left join t_project_iteration i6 on a.iteration_id=i6.id where a.object_type=2 and a.is_delete=false \";\n        var ArrayList = Java.type(\"java.util.ArrayList\")\n        var values = new ArrayList()\n       \n       \n        sql=sql+\"and(  (   (a.start_date>=? or (a.start_date is null and DATE_FORMAT(a.create_time, \'%Y-%m-%d\')>=?)) and a.start_date<=?  ) or (   a.end_date>=? and a.end_date<=? ) or (   a.start_date<=? and a.end_date>=? ) or (a.finish_time is not null and DATE_FORMAT(a.finish_time, \'%Y-%m-%d\')>=? and DATE_FORMAT(a.finish_time, \'%Y-%m-%d\')<=?))\";\n        values.add($.toDate(startDate));\n        values.add($.toDate(startDate));\n        values.add($.toDate(endDate));\n        values.add($.toDate(startDate));\n        values.add($.toDate(endDate));\n        values.add($.toDate(startDate));\n        values.add($.toDate(endDate))\n        values.add($.toDate(startDate));\n        values.add($.toDate(endDate));\n        sql=sql+\' order by a.status,a.create_time limit 102400\';\n		var taskList=$.queryList(sql,values)\n        return taskList;\n		\n	}\n    \n}\n', '全部项目的缺陷导出', '{\"query\":[{\"name\":\"开始时间\",\"type\":\"date\"},{\"name\":\"结束时间\",\"type\":\"date\"}]}', 397, 397, '2020-11-19 16:28:25', '2020-11-19 18:58:52');
