e(startDate));\n        values.add($.toDate(startDate));\n        values.add($.toDate(endDate));\n        values.add($.toDate(startDate));\n        values.add($.toDate(endDate));\n        values.add($.toDate(startDate));\n        values.add($.toDate(endDate))\n        values.add($.toDate(startDate));\n        values.add($.toDate(endDate));\n        sql=sql+\' order by a.status,a.create_time limit 102400\';\n		var taskList=$.queryList(sql,values)\n        return taskList;\n		\n	}\n    \n}\n', '待办事项列表', '{\"query\":[{\"name\":\"项目\",\"type\":\"project\"},{\"name\":\"开始时间\",\"type\":\"date\"},{\"name\":\"结束时间\",\"type\":\"date\"}]}', 397, 397, '2020-11-20 17:36:01', '2020-11-20 17:45:59');
