-- ----------------------------
-- Table structure for t_account
-- ----------------------------
DROP TABLE IF EXISTS `t_account`;
CREATE TABLE `t_account` (
                             `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
                             `name` varchar(64) DEFAULT NULL COMMENT '名称',
                             `user_name` varchar(64) NOT NULL DEFAULT '' COMMENT '用户名',
                             `pinyin_name` varchar(128) DEFAULT NULL COMMENT '拼音',
                             `ad_name` varchar(64) DEFAULT NULL COMMENT 'AD域账号',
                             `dingtalk_member_id` int(11) DEFAULT NULL COMMENT '钉钉账号',
                             `supplier_id` int(11) DEFAULT NULL COMMENT '供应商',
                             `uuid` varchar(64) DEFAULT NULL COMMENT 'UUID',
                             `cal_uuid` varchar(64) DEFAULT NULL COMMENT '日历uuid',
                             `mobile_no` varchar(32) DEFAULT NULL COMMENT '手机号',
                             `email` varchar(128) DEFAULT NULL COMMENT '邮箱',
                             `before_last_password` varchar(128) DEFAULT NULL COMMENT '上上次密码',
                             `last_password` varchar(128) DEFAULT NULL COMMENT '上次密码',
                             `password` varchar(128) DEFAULT NULL COMMENT '密码',
                             `encrypt_password` varchar(128) DEFAULT NULL COMMENT '可以解密的密码',
                             `access_token` varchar(64) DEFAULT NULL COMMENT 'accessToken',
                             `wx_open_id` varchar(64) DEFAULT '' COMMENT '微信openId',
                             `wx_union_id` varchar(128) DEFAULT NULL COMMENT 'unionId',
                             `wx_nickname` varchar(64) DEFAULT '' COMMENT '昵称',
                             `xcx_open_id` varchar(64) DEFAULT NULL COMMENT '小程序openid',
                             `xcx_session_key` varchar(64) DEFAULT NULL COMMENT 'sessionKey',
                             `sex` tinyint(4) unsigned DEFAULT '0' COMMENT '性别',
                             `headimgurl` varchar(256) DEFAULT NULL COMMENT '微信头像',
                             `province` varchar(255) DEFAULT NULL COMMENT '省份',
                             `city` varchar(255) DEFAULT NULL COMMENT '城市',
                             `image_id` varchar(64) DEFAULT NULL COMMENT '头像',
                             `status` int(11) DEFAULT NULL COMMENT '状态',
                             `is_activated` tinyint(4) DEFAULT NULL COMMENT '是否激活',
                             `last_login_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后登录时间',
                             `company_id` int(11) DEFAULT NULL COMMENT '企业',
                             `create_account_id` int(11) DEFAULT NULL COMMENT '创建人',
                             `update_account_id` int(11) DEFAULT NULL COMMENT '更新人',
                             `need_update_password` tinyint(4) DEFAULT NULL COMMENT '是否需要强制更新密码',
                             `daily_login_fail_count` int(11) DEFAULT NULL COMMENT '每日登陆失败次数',
                             `lark_open_id` varchar(64) DEFAULT NULL COMMENT '飞书OPENID',
                             `lark_tenant_key` varchar(64) DEFAULT NULL COMMENT '飞书tenantKey',
                             `disable_end_time` datetime DEFAULT NULL COMMENT '解锁时间',
                             `kaptcha_error_count` int(10) unsigned DEFAULT NULL COMMENT '验证码输错次数',
                             `qywx_user_id` varchar(32) DEFAULT NULL COMMENT '企业微信UserId',
                             `dingtalk_user_id` varchar(64) DEFAULT NULL COMMENT '钉钉UserId',
                             `register_ip` varchar(32) DEFAULT NULL COMMENT '注册ip',
                             `super_boss` int(11) DEFAULT '0' COMMENT '超级boss权限',
                             `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
                             `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最新时间',
                             PRIMARY KEY (`id`),
                             UNIQUE KEY `user_name` (`user_name`),
                             UNIQUE KEY `mobile_no` (`mobile_no`),
                             UNIQUE KEY `email` (`email`),
                             UNIQUE KEY `uuid` (`uuid`),
                             UNIQUE KEY `wx_open_id` (`wx_open_id`),
                             UNIQUE KEY `wx_union_id` (`wx_union_id`),
                             UNIQUE KEY `lark_open_id` (`lark_open_id`),
                             UNIQUE KEY `qywx_user_id` (`qywx_user_id`),
                             KEY `access_token` (`access_token`),
                             KEY `daily_login_fail_count` (`daily_login_fail_count`)
) ENGINE=InnoDB AUTO_INCREMENT=394 DEFAULT CHARSET=utf8mb4 COMMENT='用户';

-- ----------------------------
-- Records of t_account
-- ----------------------------
BEGIN;
COMMIT;

