                             `activity_count` varchar(512) DEFAULT NULL COMMENT '15天活动次数',
                             `start_date` datetime DEFAULT NULL COMMENT '开始时间',
                             `end_date` datetime DEFAULT NULL COMMENT '截止日期',
                             `is_finish` tinyint(4) DEFAULT '0' COMMENT '是否结束',
                             `finish_date` datetime DEFAULT NULL COMMENT '结束日期',
                             `expect_work_time` int(11) DEFAULT NULL COMMENT '预计工时',
                             `owner_account_id_list` varchar(512) DEFAULT NULL COMMENT '项目责任人',
                             `owner_account_list` text COMMENT '项目责任人',
                             `leader_account_id_list` varchar(512) DEFAULT NULL COMMENT '分管领导',
