                          `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
                          `company_id` int(11) NOT NULL COMMENT '企业',
                          `project_id` int(11) NOT NULL COMMENT '项目',
                          `iteration_id` int(11) NOT NULL COMMENT '迭代',
                          `object_type` int(11) NOT NULL COMMENT '类型',
                          `name` varchar(128) NOT NULL DEFAULT '' COMMENT '名称',
                          `uuid` varchar(64) NOT NULL DEFAULT '' COMMENT 'UUID',
                          `serial_no` varchar(32) NOT NULL DEFAULT '' COMMENT '序列号',
