                          `expect_end_date` date DEFAULT NULL COMMENT '预计截止时间',
                          `expect_work_time` int(11) unsigned NOT NULL COMMENT '预计工时',
                          `work_time` double(8,2) unsigned NOT NULL COMMENT '实际工时',
  `work_load` double(8,2) DEFAULT '0.00' COMMENT '工作量',
  `is_delete` tinyint(11) NOT NULL COMMENT '是否删除',
