  `category_id_list` varchar(512) DEFAULT NULL COMMENT '分类列表',
  `start_days` int(11) DEFAULT NULL COMMENT '已用天数',
  `end_days` int(11) DEFAULT NULL COMMENT '剩余天数',
  `reopen_count` int(11) DEFAULT NULL COMMENT '重新打开次数',
  `is_finish` tinyint(11) DEFAULT NULL COMMENT '是否完成',
  `finish_time` datetime DEFAULT NULL COMMENT '完成时间',
  `owner_account_id_list` varchar(512) DEFAULT NULL COMMENT '责任人',
  `owner_account_list` text COMMENT '责任人',
  `leader_account_id_list` varchar(512) DEFAULT NULL COMMENT '分管领导',
  `leader_account_list` text COMMENT '分管领导',
  `first_owner` varchar(512) DEFAULT NULL COMMENT '初始责任人',
  `last_owner` varchar(512) DEFAULT NULL COMMENT '上一个责任人',
  `is_create_index` tinyint(4) NOT NULL COMMENT '是否建立索引',
  `progress` int(10) unsigned DEFAULT NULL COMMENT '进度',
  `associate_project_id` int(11) DEFAULT NULL COMMENT '关联其它项目ID',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uuid` (`uuid`),
  UNIQUE KEY `company_id_2` (`company_id`,`serial_no`),
  KEY `company_id` (`company_id`),
  KEY `project_id` (`project_id`),
  KEY `parent_id` (`parent_id`)
) ENGINE=InnoDB AUTO_INCREMENT=20129 DEFAULT CHARSET=utf8mb4 COMMENT='任务';

