DROP PROCEDURE IF EXISTS `add_company_issue_data_table`;
delimiter ;;
CREATE PROCEDURE `add_company_issue_data_table`()
BEGIN
	DECLARE _company_id int;
	DECLARE s int DEFAULT 0;
	DECLARE cur1 CURSOR FOR SELECT id FROM t_company where id>1;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET s=1;
open cur1;
fetch cur1 into _company_id;
while s<>1 do
SELECT _company_id,`name`,`group`,roles,enable_role,`status`,is_delete,script,remark,data_table_define,create_account_id,update_account_id,create_time,update_time FROM t_data_table WHERE NAME='项目待办事项' OR NAME='全局缺陷';
fetch cur1 into _company_id;
end while;
close cur1;
END
;;
delimiter ;

