-- ----------------------------
-- Procedure structure for proc_check_data
-- ----------------------------
DROP PROCEDURE IF EXISTS `proc_check_data`;
delimiter ;;
CREATE PROCEDURE `proc_check_data`()
BEGIN
	declare count int;
select count(1) into count from t_project_field_define where project_id not in(select id from t_project);
if (count > 0) then
end if;

select count(1) into count from t_project_iteration where project_id not in(select id from t_project);
if (count > 0) then
end if;
select count(1) into count from t_project_priority_define where project_id not in(select id from t_project);
if (count > 0) then
end if;

select count(1) into count from t_project_field_define a inner join t_project b on a.project_id=b.id where a.company_id!=b.company_id;
if (count > 0) then
end if;

select count(1) into count from t_project_priority_define a inner join t_project b on a.project_id=b.id where a.company_id!=b.company_id;
if (count > 0) then
end if;

select count(1) into count from t_project_status_define a inner join t_project b on a.project_id=b.id where a.company_id!=b.company_id;
if (count > 0) then
end if;

select count(1) into count from t_project_module a inner join t_project b on a.project_id=b.id where a.company_id!=b.company_id;
if (count > 0) then
end if;

select count(1) into count from t_file where path is null;
if (count > 0) then
end if;

select count(1) into count from t_file a inner join t_file b on a.parent_id=b.id where a.level!=b.level+1;
if (count > 0) then
end if;

select count(1) into count from t_file a where a.level!=1 and a.parent_id=0;
if (count > 0) then
end if;

select count(1) into count from t_task a where a.sub_task_count!=(select count(1) from t_task b where b.parent_id=a.id and b.is_delete=false);
if (count > 0) then
end if;

select count(1) into count from t_task a where a.finish_sub_task_count!=(select count(1) from t_task b where b.`parent_id`=a.id and b.is_finish=true and b.is_delete=false);
if (count > 0) then
end if;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for setup_task_associate_count
-- ----------------------------
DROP PROCEDURE IF EXISTS `setup_task_associate_count`;
delimiter ;;
CREATE PROCEDURE `setup_task_associate_count`()
BEGIN
	DECLARE _task_id int;
	DECLARE _associate_count int;
	DECLARE s int DEFAULT 0;
	DECLARE cur1 CURSOR FOR SELECT task_id,COUNT(task_id) as associateCount FROM t_task_associated t LEFT JOIN t_task t1 ON t.`associated_task_id` = t1.`id` WHERE t1.`is_delete` = FALSE GROUP BY task_id;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET s=1;
open cur1;
fetch cur1 into _task_id,_associate_count;
while s<>1 do
UPDATE t_task SET associate_count =_associate_count  WHERE id =_task_id;
fetch cur1 into _task_id,_associate_count;
end while;
close cur1;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for sync_account_project_star_data
-- ----------------------------
DROP PROCEDURE IF EXISTS `sync_account_project_star_data`;
delimiter ;;
CREATE PROCEDURE `sync_account_project_star_data`()
BEGIN
	DECLARE _company_id INT;
	DECLARE _project_id INT;
	DECLARE _account_id INT;
	DECLARE s INT DEFAULT 0;
	DECLARE memberStar CURSOR FOR SELECT account_id ,company_id,project_id FROM t_project_member WHERE star=1;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET s=1;
OPEN memberStar;
FETCH memberStar INTO _account_id,_company_id,_project_id;
WHILE s<>1 DO
			VALUES (_company_id, _account_id, _project_id, 1);
FETCH memberStar INTO _account_id,_company_id,_project_id;
END WHILE;
CLOSE memberStar;
END
;;
delimiter ;

